import React from 'react';
import { Router, Route, Switch } from 'react-router-dom';
import StreamCreate from './StreamsComponents/StreamCreate';
import StreamDelete from './StreamsComponents/StreamDelete';
import StreamEdit from './StreamsComponents/StreamEdit';
import StreamList from './StreamsComponents/StreamList';
import StreamShow from './StreamsComponents/StreamShow';
import Header from './Header';
import history from '../history';

const App = () => {
    return (
        <div className="ui container">
            <Router history={history}>
                <div>
                    <Header/>
                    <Switch>
                        <Route path="/" exact component={StreamList} />
                        <Route path="/streams/new" exact component={StreamCreate} />
                        <Route path="/streams/edit/:id" exact component={StreamEdit} />
                        <Route path="/streams/delete/:id" exact component={StreamDelete} />
                        <Route path="/streams/:id" exact component={StreamShow} />
                    </Switch>
                    
                </div>
            </Router>
        </div>
    );
};

export default App;
